from minelab.datasets.RTIC import Rtic
from minelab.datasets.TRAJECTORY import Trajectory
from minelab.datasets.CNTF import Cntf

"""
数据解析类
"""
class DataParse:
    def __init__(self,data_kind,line):
        '''
        :param data_kind: 0->rtic,1->trajectory,2->cntf
        :param line:
        '''
        self.__data_kind=data_kind
        self.__data_line=line
    def data_parse(self):
        if self.__data_kind==0:
            data=Rtic(self.__data_line)
            print(data)
        if self.__data_kind==1:
            data=Trajectory(self.__data_line)
            print(data)
        if self.__data_kind==2:
            data=Cntf(self.__data_line)
            print(data)

